import React from 'react';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';

// Registrar los componentes de ChartJS
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const TestDetails = ({ testData }) => {
  // Asumiendo que los datos de tiempo, SPO2 y HR vienen de `testData`
  const timeValues = testData.data.map((entry) => entry.t);
  const spoValues = testData.data.map((entry) => entry.s);
  const hrValues = testData.data.map((entry) => entry.h);

  const checkpointTimes = testData.pascon.map((entry) => entry.t);
  const checkpointSpo = testData.pascon.map((entry) => entry.s);
  const checkpointHr = testData.pascon.map((entry) => entry.h);

  // Datos para el gráfico de SPO2 y HR
  const spo2HrData = {
    labels: timeValues,
    datasets: [
      {
        label: 'SPO2',
        data: spoValues,
        borderColor: 'blue',
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        fill: false,
      },
      {
        label: 'Heart Rate',
        data: hrValues,
        borderColor: 'red',
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        fill: false,
      },
    ],
  };

  // Datos para los checkpoints
  const checkpointData = {
    labels: checkpointTimes,
    datasets: [
      {
        label: 'Checkpoint SPO2',
        data: checkpointSpo,
        borderColor: 'blue',
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        fill: false,
        pointStyle: 'circle',
        pointRadius: 5,
      },
      {
        label: 'Checkpoint HR',
        data: checkpointHr,
        borderColor: 'red',
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        fill: false,
        pointStyle: 'circle',
        pointRadius: 5,
      },
    ],
  };

  // Opciones de los gráficos
  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'SPO2 and Heart Rate over Time',
      },
    },
  };

  return (
    <div>
      <h2>Test Details</h2>

      {/* Gráfico de Checkpoints */}
      <div>
        <h3>Checkpoints Graph</h3>
        <Line data={checkpointData} options={options} />
      </div>

      {/* Gráfico de SPO2 y HR */}
      <div>
        <h3>SPO2 and Heart Rate</h3>
        <Line data={spo2HrData} options={options} />
      </div>
    </div>
  );
};

export default TestDetails;
